reviewText:
Two problems:
 !.  Too damn plodding and parks on jokes too much rather than hitting them and moving on;
2.  Language is distractingly unauthentic.  I am not a prude, not shocked . . . and I have no problem with hard profanity in the contexts where it belongs . . . but I do not believe for a minute than any real VEEP would so carelessly throw around F bombs like this one - and virtually every character does.  Way over done by too many characters and too frequent use.  Staffers should be inserting the F bombs selectively and behind the VEEP's back.  She should not condone habitual language that could not be used in her public persona - it ain't funny.
